import React, {Component} from 'react';
import '../../App.css';
//import axios from 'axios';
//import cookie from 'react-cookies';
//import {Redirect} from 'react-router';

class BuyerProfile extends Component {


    render() {

        let profilePicture = () => {
            return(
                <div>
                    <h4>Profile Picture</h4>
                    <img></img> 
                </div>
            )
        } 

        let buyerProfile = () => {
            return(
                <div>
                <div><h4>Your Account</h4><br/>
                <h5>Name</h5>
                </div>

                <div>
                <h5>Email</h5>
                </div>
                <div>
                <h5>Password</h5>
                </div>
                </div>
            )
        }

        let buyerPhone = () => {
            return(
                <div>
                    <h4>Phone Number</h4><br/>
                    <h5>Home<br/>
                    6692789950
                    </h5>
                </div>
            )
        }


        return(
            <div>
                <div>
                    <br/>
                    <br/>
                </div>
                <div class="col-md-3 profile-div">
                <h3 class="font-bold">Your Account</h3><br/>
                <h5 class="font-bold"><a>Profile Picture</a></h5><br/>
                <h5 class="font-bold"><a>Profile</a></h5><br/>
                <h5 class="font-bold"><a>Phone</a></h5><br/>
                </div>

                <div></div>

                <div class="col-md-8 profile-div">

                </div>
            </div>
        )
    }
}

export default BuyerProfile;
